  deadline_factor.init(rand);
  duration.init(rand);
  reservation.init(rand);

  for(TaskDefinition t : tasks){
    t.count.init(rand);
    t.time.init(rand);
    t.max_memory.init(rand);
    t.max_vcores.init(rand);
  }
}
